import styles from "./Books.module.css";
import { useEffect, useState } from "react";
function Books() {
  const [fet, onfet] = useState();
  useEffect(() => {
    fetch(
      `https://www.googleapis.com/books/v1/volumes?q=A&key=AIzaSyCDgRAXUYvnfJtU9bAOBlh0SU9Lu7MkhpE`
    )
      .then((e) => {
        return e.json();
      })
      .then((e) => {
        console.log(e);
        onfet(e);
      })
      .catch((error) => {
        console.log(error);
      });
  });
  return (
    <div className={styles.books}>
      <div className={styles.books1}>1</div>
      <div className={styles.books2}>2</div>
      <div className={styles.books3}>3</div>
      <div className={styles.books4}>4</div>
      <div className={styles.books5}>5</div>
      <div className={styles.books6}>6</div>
      <div className={styles.books7}>7</div>
      <div className={styles.books8}>8</div>
    </div>
  );
}
export default Books;
